"use strict";

// padding no-ios
document.addEventListener("DOMContentLoaded", function () {
  var dateItems = document.querySelectorAll('.promotion__date-item');
  var regBtns = document.querySelectorAll('.promotion__regBtn');
  var enterBtns = document.querySelectorAll('.promotion__enterBtn');
  if (!/iPad|iPhone|iPod|Mac/.test(navigator.userAgent)) {
    dateItems.forEach(function (item) {
      return item.classList.add('noios-padding');
    });
    regBtns.forEach(function (btn) {
      return btn.classList.add('noios-padding');
    });
    enterBtns.forEach(function (btn) {
      return btn.classList.add('noios-padding');
    });
  }
});
"use strict";
